import React from "react";
import "./home.css";

const Home = () => {
  return (
    <>
      <div className="flex-container">
        <div className="flex-item-left">1</div>
        <div className="flex-item-right">
          <img
            src="image/n.jpg"
            alt="Italian Trulli"
            height="500"
            width="320"
          />
        </div>
        <div></div>
        <div className="flex">3</div>
      </div>
    </>
  );
};

export default Home;
